import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min";
import HeaderComponent from "./component/HeaderComponent";
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom'
import { isUserLoggedIn } from "./services/AuthService";
import RegisterCompon from "./component/RegisterComponent";
import AdminComponent from "./component/AdminComponent";
import UserComponent from "./component/UserComponent";


function App() {



  function AuthenticatedRoutes({ children }) {

    const isAuth = "";
    isAuth = isUserLoggedIn();

    if (isAuth) {

      return children;

    }

    else return <Navigate to="/"  ></Navigate>




  }

  return (
    <>


      <BrowserRouter>
        <HeaderComponent />

        <Routes>






          <Route path="/admin" element={<AdminComponent />}></Route>
          <Route path="/user" element={<UserComponent></UserComponent>} ></Route>
          <Route path='/register' element={<RegisterCompon />} ></Route>






        </Routes>



      </BrowserRouter>



      <h1>Ana sayfa </h1>
      <p>Ana sayfa</p>



    </>
  );
}

export default App;
